            "textDisplay": "Detailed Translation of the Lyrics: \u003cbr\u003e\r\u003cbr\u003eBabe I‚Äôm Gangnam Style \r\u003cbr\u003eGangnam Style\r\u003cbr\u003eDuring the day, she is a warm and down to earth person.\r\u003cbr\u003eA woman with class who has the time of day to relax and enjoy a cup of coffee\r\u003cbr\u003eA woman whose heart starts burning with passion when the night comes\r\u003cbr\u003eA woman with such a twist\r\u003cbr\u003e\r\u003cbr\u003eI&#39;m an alpha male\r\u003cbr\u003eDuring the day, I&#39;m just as warm and genuine as you\r\u003cbr\u003eI&#39;m an alpha male. The kind that can one shot a cup of coffee  without hesitation before it cools down \r\u003cbr\u003eDuring the night, I‚Äôm an alpha male whose heart explodes with passion\r\u003cbr\u003eI&#39;m this type of man \r\u003cbr\u003e\r\u003cbr\u003eBeautiful, Lovely\r\u003cbr\u003eYes I&#39;m talking about you, exactly you\r\u003cbr\u003e\r\u003cbr\u003eStarting now, before we go (black out or go home) shall we mess around?\r\u003cbr\u003e\r\u003cbr\u003eBabe I‚Äôm Gangnam Style\r\u003cbr\u003e\r\u003cbr\u003eA woman who seems gentle and shybut parties hard when its time\r\u003cbr\u003eA woman who unties her neatly touched hair when she feels her moment and gets in the zone\r\u003cbr\u003eA woman who shows no skinbut manages to be more erotic than if she was showing skin\r\u003cbr\u003eShe‚Äôs that type of sensuous woman \r\u003cbr\u003e\r\u003cbr\u003eI&#39;m an alpha male\r\u003cbr\u003eI appear to be gentle but party hard when it&#39;s time\r\u003cbr\u003eWhen it&#39;s time to party, I&#39;m an alpha male that goes absolutely insane\r\u003cbr\u003eI&#39;m an alpha male that has an imagination far more ripped than my muscles (He is saying his imagination goes wild with the girl)\r\u003cbr\u003eI‚Äôm that type of man \r\u003cbr\u003e\r\u003cbr\u003eBeautiful, Lovely \r\u003cbr\u003eYes I‚Äôm talking about you, exactly you 2x\r\u003cbr\u003e\r\u003cbr\u003eStarting now, before we go (black out or go home) shall we mess around?\r\u003cbr\u003e\r\u003cbr\u003eA man who is on the move/running or a man whose heart beats with passion (up to interpretation), a man that flies above 2x\r\u003cbr\u003e\r\u003cbr\u003eBaby I‚Äôm a man that knows exactly what he‚Äôs talking about \r\u003cbr\u003eYou know what I‚Äôm saying?\r\u003cbr\u003e\r\u003cbr\u003eBabe I‚Äôm Gangnam Style\u003cbr\u003e\u003cbr\u003e(The Korean language has a lot implied emotional meanings to words that direct translation will never explain. This is a translation I made that goes deep into the many hidden emotional meanings this song has. Certain words also do not have direct translations. Oppa for example is very different depending on the context. In this song&#39;s context, Babe is much more fitting than the direct translation that is brother. Ssanai is also directly translated into simply &quot;man&quot; and this does not do the word justice. The word Ssanai is usually in context of alpha males, studs, etc.) \r\u003cbr\u003eWhat the lyrics are about: A song about an absolute simp and cringe lord who is trying to seduce a classy, hot girl. \r\u003cbr\u003eGangnam is a super wealthy neighborhood in Korea that has a lot of class.\u003cbr\u003e\u003cbr\u003eWhy I bothered doing this at all: I was a middle schooler when I first listened to this legendary song. At the time, I didn&#39;t care for the lyrics. I just vibed hard because this song just bangs so hard. However, watching this again after so many years, I took a deep look at the lyrics. A lot of translations that immediately appear on Google or Naver do not do the lyrics justice (they directly translate the words and many things get lost in translatation) so I thought it would be fun to translate this song with all the metaphors/implications of these lyrics. I see this song in a new light now and I love it more than I ever did. I hope this helps people feel the spirit and passion Psy&#39;s heart through this Kpop classic. \r\u003cbr\u003eIf it hasn&#39;t been made clear yet, I am a native Korean speaker so I hope this helps with the credibility of this translation. If any other Koreans want to chime in their interpretation of the lyrics please do so.",
            "textOriginal": "Detailed Translation of the Lyrics: \n\r\nBabe I‚Äôm Gangnam Style \r\nGangnam Style\r\nDuring the day, she is a warm and down to earth person.\r\nA woman with class who has the time of day to relax and enjoy a cup of coffee\r\nA woman whose heart starts burning with passion when the night comes\r\nA woman with such a twist\r\n\r\nI'm an alpha male\r\nDuring the day, I'm just as warm and genuine as you\r\nI'm an alpha male. The kind that can one shot a cup of coffee  without hesitation before it cools down \r\nDuring the night, I‚Äôm an alpha male whose heart explodes with passion\r\nI'm this type of man \r\n\r\nBeautiful, Lovely\r\nYes I'm talking about you, exactly you\r\n\r\nStarting now, before we go (black out or go home) shall we mess around?\r\n\r\nBabe I‚Äôm Gangnam Style\r\n\r\nA woman who seems gentle and shybut parties hard when its time\r\nA woman who unties her neatly touched hair when she feels her moment and gets in the zone\r\nA woman who shows no skinbut manages to be more erotic than if she was showing skin\r\nShe‚Äôs that type of sensuous woman \r\n\r\nI'm an alpha male\r\nI appear to be gentle but party hard when it's time\r\nWhen it's time to party, I'm an alpha male that goes absolutely insane\r\nI'm an alpha male that has an imagination far more ripped than my muscles (He is saying his imagination goes wild with the girl)\r\nI‚Äôm that type of man \r\n\r\nBeautiful, Lovely \r\nYes I‚Äôm talking about you, exactly you 2x\r\n\r\nStarting now, before we go (black out or go home) shall we mess around?\r\n\r\nA man who is on the move/running or a man whose heart beats with passion (up to interpretation), a man that flies above 2x\r\n\r\nBaby I‚Äôm a man that knows exactly what he‚Äôs talking about \r\nYou know what I‚Äôm saying?\r\n\r\nBabe I‚Äôm Gangnam Style\n\n(The Korean language has a lot implied emotional meanings to words that direct translation will never explain. This is a translation I made that goes deep into the many hidden emotional meanings this song has. Certain words also do not have direct translations. Oppa for example is very different depending on the context. In this song's context, Babe is much more fitting than the direct translation that is brother. Ssanai is also directly translated into simply \"man\" and this does not do the word justice. The word Ssanai is usually in context of alpha males, studs, etc.) \r\nWhat the lyrics are about: A song about an absolute simp and cringe lord who is trying to seduce a classy, hot girl. \r\nGangnam is a super wealthy neighborhood in Korea that has a lot of class.\n\nWhy I bothered doing this at all: I was a middle schooler when I first listened to this legendary song. At the time, I didn't care for the lyrics. I just vibed hard because this song just bangs so hard. However, watching this again after so many years, I took a deep look at the lyrics. A lot of translations that immediately appear on Google or Naver do not do the lyrics justice (they directly translate the words and many things get lost in translatation) so I thought it would be fun to translate this song with all the metaphors/implications of these lyrics. I see this song in a new light now and I love it more than I ever did. I hope this helps people feel the spirit and passion Psy's heart through this Kpop classic. \r\nIf it hasn't been made clear yet, I am a native Korean speaker so I hope this helps with the credibility of this translation. If any other Koreans want to chime in their interpretation of the lyrics please do so.",
